import { v4 as uuidv4 } from "uuid";

const player = "https://source.unsplash.com/1600x900/?music";
const portfolio = "https://source.unsplash.com/1600x900/?webdeveloper";

const projects = [
  {
    id: uuidv4(),
    name: "Talga Player",
    desc: "Tech: React, Redux, Styled-Components.",
    img: player,
  },
  {
    id: uuidv4(),
    name: "Personal Portfolio",
    desc: "Tech: React, Styled-Components.",
    img: portfolio,
  },
  {
    id: uuidv4(),
    name: "Talga Online-Shop",
    desc: "Tech: React, Stripe, Styled-Components.",
    img: player,
  },
  {
    id: uuidv4(),
    name: "Talga Player",
    desc: "Tech: HTML5, CSS3, Javascript, React, Redux, Styled-Components.",
    img: player,
  },
];

export default projects;
